import React from 'react';

import { ContainerHome, LogoContent, Messages} from './styles';
import Header from './../../components/Header';
import logo from './../'

const Home = () => {
    return (
        <>

            <ContainerHome>

                <LogoContent>
                    <img src={logo}></img>
                </LogoContent>


                <Messages>
                    <h1>Bem-Vindo</h1>
                    <p>
                    A LAENEDU auxilia no desenvolvimento e engajamento de colaboradores por meio de ações em parcerias com instituições e projetos sociais.
                    </p>
                </Messages>
            </ContainerHome>
        </>
    )
}


export default Home;
